import React from 'react';
import {
  StyleSheet,
  Text,
  View,
  SafeAreaView,
  Button,
  ImageBackground,
  Platform,
  StatusBar,
} from 'react-native';

const WelcomeScreen = () => {
  return <ImageBackground source={require('../assets')}></ImageBackground>;
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'orange',
    justifyContent: 'center',
    alignItems: 'center',
    paddingTop: Platform.OS === 'android' ? StatusBar.currentHeight : 0,
  },
});

export default WelcomeScreen;
